import listaDiretorios from './Formas/listaDiretorios';  

import addDiretorio from './Formas/addDiretorio';
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';  

import './App.css';


function App() {
  return (
    <Router>  
    <div className="container">  
      <nav className="navbar navbar-expand-lg navheader">  
        <div className="collapse navbar-collapse" >  
          <ul className="navbar-nav mr-auto">  
            <li className="nav-item">  
              <Link to={'/listaDiretorios'} className="nav-link">listaDiretorios</Link>  
            </li>  
            <li className="nav-item">  
              <Link to={'/addDiretorio'} className="nav-link">addDiretorio</Link>  
            </li>  
          </ul>  
        </div>  
      </nav> <br />  
      <Switch>  
        <Route exact path='/listaDiretorios' component={listaDiretorios} />  

        <Route path='/listaDiretorios' component={listaDiretorios} />  
      </Switch>  
    </div>  
  </Router>  
  );
}

export default App;
